import React from 'react';
import Booking from './Booking'
import Food from './Food'

class Root extends React.Component{

  constructor(){
    super();
    this.state = {doneWithBooking: true, doneWithFood: false, doneWithFeedback: false}
  }
  render(){
    return(<div>
      <b>{this.state.doneWithBooking ? <Food/> : <Booking/>}</b>
      {this.test()}
    </div>)
  }

  test = () => {
    if(this.state.doneWithBooking === true){
      return <h1>hey</h1>
    } else {
      return <h1>bye</h1>
    }

  }
}

export default Root;
